searchData={"items":[{"type":"module","title":"TheFuzz","doc":"Contains shortforms to execute different string metric algorithms to compare \ngiven strings.","ref":"TheFuzz.html"},{"type":"function","title":"TheFuzz.compare/3","doc":"Compares given strings using the corresponding string metric algorithm.\n\nAvailable metric types are:\n- Damerau-Levenshtein distance: **:damerau_levenshtein**\n- Sorensen Dice coefficient: **:dice_sorensen**\n- Hamming distance: **:hamming**\n- Jaccard Similarity coefficient: **:jaccard**\n- Jaro distance: **:jaro**\n- Jaro Winkler distance: **:jaro_winkler**\n- Levenshtein distance: **:levenshtein**\n- n Gram similarity: **:n_gram** \n- Overlap coefficient: **:overlap**\n- Tanimoto coefficient: **:tanimoto**\n- Weighted Levenshtein distance: **:weighted_levenshtein**\n\nNote: Some of these metrics will use default values for other parameters\nthey might need like n gram size in case of Jaccard","ref":"TheFuzz.html#compare/3"},{"type":"function","title":"TheFuzz.compare/4","doc":"Compares given strings using the corresponding string metric algorithm with \ngiven `opts`\n\n`opts` can be n gram size in case of Dice Sorensen, Jaccard, N Gram similarity\nand can be weights in case of Weighted Levenshtein\n\nAvailable metric types are:\n- Sorensen Dice coefficient: **:dice_sorensen**\n- Jaccard Similarity coefficient: **:jaccard**\n- n Gram similarity: **:n_gram** \n- Tversky index: **:tversky**\n- Weighted Levenshtein distance: **:weighted_levenshtein**","ref":"TheFuzz.html#compare/4"},{"type":"module","title":"TheFuzz.Phonetic.MetaphoneAlgorithm","doc":"Calculates the [Metaphone Phonetic Algorithm](http://en.wikipedia.org/wiki/\nMetaphone) of a string.","ref":"TheFuzz.Phonetic.MetaphoneAlgorithm.html"},{"type":"function","title":"TheFuzz.Phonetic.MetaphoneAlgorithm.compute/1","doc":"Returns the Metaphone phonetic version of the provided string.","ref":"TheFuzz.Phonetic.MetaphoneAlgorithm.html#compute/1"},{"type":"function","title":"Examples - TheFuzz.Phonetic.MetaphoneAlgorithm.compute/1","doc":"iex> TheFuzz.Phonetic.MetaphoneAlgorithm.compute(\"z\")\n    \"s\"\n    iex> TheFuzz.Phonetic.MetaphoneAlgorithm.compute(\"ztiaz\")\n    \"sxs\"","ref":"TheFuzz.Phonetic.MetaphoneAlgorithm.html#compute/1-examples"},{"type":"module","title":"TheFuzz.Phonetic.MetaphoneMetric","doc":"Calculates the [Metaphone Phonetic Algorithm](http://en.wikipedia.org/wiki/\nMetaphone) metric of two strings.","ref":"TheFuzz.Phonetic.MetaphoneMetric.html"},{"type":"function","title":"TheFuzz.Phonetic.MetaphoneMetric.compare/2","doc":"Compares two values phonetically and returns a boolean of whether they match\n  or not.","ref":"TheFuzz.Phonetic.MetaphoneMetric.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Phonetic.MetaphoneMetric.compare/2","doc":"iex> TheFuzz.Phonetic.MetaphoneMetric.compare(\"Colorado\", \"Kolorado\")\n    true\n    iex> TheFuzz.Phonetic.MetaphoneMetric.compare(\"Moose\", \"Elk\")\n    false","ref":"TheFuzz.Phonetic.MetaphoneMetric.html#compare/2-examples"},{"type":"module","title":"TheFuzz.Similarity.DamerauLevenshtein","doc":"This module contains functions to calculate the Damerau-Levenshtein distance between\ngiven strings.","ref":"TheFuzz.Similarity.DamerauLevenshtein.html"},{"type":"function","title":"TheFuzz.Similarity.DamerauLevenshtein.compare/2","doc":"Calculates the Damerau-Levenshtein distance between two given strings.","ref":"TheFuzz.Similarity.DamerauLevenshtein.html#compare/2"},{"type":"function","title":"examples - TheFuzz.Similarity.DamerauLevenshtein.compare/2","doc":"iex> TheFuzz.Similarity.DamerauLevenshtein.compare(\"saturday\", \"sunday\")\n    3\n    iex> TheFuzz.Similarity.DamerauLevenshtein.compare(\"fuor\", \"four\")\n    1","ref":"TheFuzz.Similarity.DamerauLevenshtein.html#compare/2-examples"},{"type":"module","title":"TheFuzz.Similarity.DiceSorensen","doc":"This module contains functions to calculate the Sorensen-Dice coefficient of\n2 given strings.","ref":"TheFuzz.Similarity.DiceSorensen.html"},{"type":"function","title":"TheFuzz.Similarity.DiceSorensen.compare/2","doc":"Calculates the Sorensen-Dice coefficient of two given strings with the ngram\nsize set to a default value of 2.","ref":"TheFuzz.Similarity.DiceSorensen.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.DiceSorensen.compare/2","doc":"iex> TheFuzz.Similarity.DiceSorensen.compare(\"night\", \"nacht\")\n    0.25\n    iex> TheFuzz.Similarity.DiceSorensen.compare(\"context\", \"contact\")\n    0.5","ref":"TheFuzz.Similarity.DiceSorensen.html#compare/2-examples"},{"type":"function","title":"TheFuzz.Similarity.DiceSorensen.compare/3","doc":"Calculates the Sorensen-Dice coefficient of two given strings with a\nspecified ngram size passed as the third argument.","ref":"TheFuzz.Similarity.DiceSorensen.html#compare/3"},{"type":"function","title":"Examples - TheFuzz.Similarity.DiceSorensen.compare/3","doc":"iex> TheFuzz.Similarity.DiceSorensen.compare(\"night\", \"nacht\", 1)\n    0.6\n    iex> TheFuzz.Similarity.DiceSorensen.compare(\"night\", \"nacht\", 2)\n    0.25\n    iex> TheFuzz.Similarity.DiceSorensen.compare(\"night\", \"nacht\", 3)\n    0.0","ref":"TheFuzz.Similarity.DiceSorensen.html#compare/3-examples"},{"type":"module","title":"TheFuzz.Similarity.Hamming","doc":"This module contains functions to calculate the Hamming distance between 2\ngiven strings","ref":"TheFuzz.Similarity.Hamming.html"},{"type":"function","title":"TheFuzz.Similarity.Hamming.compare/2","doc":"Calculates the Hamming distance between 2 given strings.","ref":"TheFuzz.Similarity.Hamming.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.Hamming.compare/2","doc":"iex> TheFuzz.Similarity.Hamming.compare(\"toned\", \"roses\")\n    3\n    iex> TheFuzz.Similarity.Hamming.compare(\"toned\", \"hamming\")\n    nil\n    iex> TheFuzz.Similarity.Hamming.compare(\"toned\", \"toned\")\n    0","ref":"TheFuzz.Similarity.Hamming.html#compare/2-examples"},{"type":"module","title":"TheFuzz.Similarity.Jaccard","doc":"This module contains functions to calculate the [Jaccard similarity\ncoefficient](https://en.wikipedia.org/wiki/Jaccard_index) between two given\nstrings","ref":"TheFuzz.Similarity.Jaccard.html"},{"type":"function","title":"TheFuzz.Similarity.Jaccard.compare/2","doc":"Calculates the Jaccard similarity coefficient between two given strings with\na default ngram size of 2","ref":"TheFuzz.Similarity.Jaccard.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.Jaccard.compare/2","doc":"iex> TheFuzz.Similarity.Jaccard.compare(\"contact\", \"context\")\n    0.3333333333333333\n    iex> TheFuzz.Similarity.Jaccard.compare(\"ht\", \"hththt\")\n    0.2","ref":"TheFuzz.Similarity.Jaccard.html#compare/2-examples"},{"type":"function","title":"TheFuzz.Similarity.Jaccard.compare/3","doc":"Calculates the Jaccard similarity coefficient between two given strings with\nthe specified ngram size","ref":"TheFuzz.Similarity.Jaccard.html#compare/3"},{"type":"function","title":"Examples - TheFuzz.Similarity.Jaccard.compare/3","doc":"iex> TheFuzz.Similarity.Jaccard.compare(\"contact\", \"context\", 3)\n    0.25\n    iex> TheFuzz.Similarity.Jaccard.compare(\"contact\", \"context\", 1)\n    0.5555555555555556","ref":"TheFuzz.Similarity.Jaccard.html#compare/3-examples"},{"type":"module","title":"TheFuzz.Similarity.Jaro","doc":"Calculates the [Jaro Distance](http://en.wikipedia.org/wiki/\nJaro-Winkler_distance) between two strings.","ref":"TheFuzz.Similarity.Jaro.html"},{"type":"function","title":"TheFuzz.Similarity.Jaro.compare/2","doc":"Calculates the Jaro distance between two strings.  This used to be\nimplemented here, but since Elixir 1.1, Jaro is part of the standard lib.\nThis now uses the std lib call, but returns nil if either string is empty\nto preserve backwards compatibility with this library's original code.","ref":"TheFuzz.Similarity.Jaro.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.Jaro.compare/2","doc":"iex> TheFuzz.Similarity.Jaro.compare(\"abc\", \"\")\n    nil\n    iex> TheFuzz.Similarity.Jaro.compare(\"abc\", \"xyz\")\n    0.0\n    iex> TheFuzz.Similarity.Jaro.compare(\"compare me\", \"compare me\")\n    1.0\n    iex> TheFuzz.Similarity.Jaro.compare(\"natural\", \"nothing\")\n    0.5238095238095238","ref":"TheFuzz.Similarity.Jaro.html#compare/2-examples"},{"type":"module","title":"TheFuzz.Similarity.JaroWinkler","doc":"Calculates the [Jaro-Winkler Distance](http://en.wikipedia.org/wiki/\nJaro-Winkler_distance) between two strings.","ref":"TheFuzz.Similarity.JaroWinkler.html"},{"type":"function","title":"TheFuzz.Similarity.JaroWinkler.compare/2","doc":"Calculates the Jaro-Winkler distance between two strings.","ref":"TheFuzz.Similarity.JaroWinkler.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.JaroWinkler.compare/2","doc":"iex> TheFuzz.Similarity.JaroWinkler.compare(\"abc\", \"\")\n    nil\n    iex> TheFuzz.Similarity.JaroWinkler.compare(\"abc\", \"xyz\")\n    0.0\n    iex> TheFuzz.Similarity.JaroWinkler.compare(\"compare me\", \"compare me\")\n    1.0\n    iex> TheFuzz.Similarity.JaroWinkler.compare(\"natural\", \"nothing\")\n    0.5714285714285714","ref":"TheFuzz.Similarity.JaroWinkler.html#compare/2-examples"},{"type":"module","title":"TheFuzz.Similarity.Levenshtein","doc":"This module contains functions to calculate the levenshtein distance between\ngiven strings.","ref":"TheFuzz.Similarity.Levenshtein.html"},{"type":"function","title":"TheFuzz.Similarity.Levenshtein.compare/2","doc":"Calculates the levenshtein distance between two given strings.\n\nNote: All operations [INSERT, DELETE, REPLACE/SUBSTITUTE] are considered\nwith a cost of 1. For custom weights and limited operations use\nWeightedLevenshtein","ref":"TheFuzz.Similarity.Levenshtein.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.Levenshtein.compare/2","doc":"iex> TheFuzz.Similarity.Levenshtein.compare(\"saturday\", \"sunday\")\n    3\n    iex> TheFuzz.Similarity.Levenshtein.compare(\"book\", \"back\")\n    2","ref":"TheFuzz.Similarity.Levenshtein.html#compare/2-examples"},{"type":"module","title":"TheFuzz.Similarity.NGram","doc":"This module contains functions to calculate the ngram distance between two\ngiven strings based on this\n[paper](webdocs.cs.ualberta.ca/~kondrak/papers/spire05.pdf)","ref":"TheFuzz.Similarity.NGram.html"},{"type":"function","title":"TheFuzz.Similarity.NGram.compare/2","doc":"Calculates the ngram similarity between two given strings with a default\nngram size of 2","ref":"TheFuzz.Similarity.NGram.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.NGram.compare/2","doc":"iex> TheFuzz.Similarity.NGram.compare(\"context\", \"contact\")\n    0.5\n    iex> TheFuzz.Similarity.NGram.compare(\"ht\", \"nacht\")\n    0.25","ref":"TheFuzz.Similarity.NGram.html#compare/2-examples"},{"type":"function","title":"TheFuzz.Similarity.NGram.compare/3","doc":"Calculates the ngram similarity between two given strings with a specified\nngram size","ref":"TheFuzz.Similarity.NGram.html#compare/3"},{"type":"function","title":"Examples - TheFuzz.Similarity.NGram.compare/3","doc":"iex> TheFuzz.Similarity.NGram.compare(\"night\", \"naght\", 3)\n    0.3333333333333333\n    iex> TheFuzz.Similarity.NGram.compare(\"context\", \"contact\", 1)\n    0.7142857142857143","ref":"TheFuzz.Similarity.NGram.html#compare/3-examples"},{"type":"module","title":"TheFuzz.Similarity.Overlap","doc":"Implements the [Overlap Similarity Metric](http://en.wikipedia.org/wiki/\nOverlap_coefficient)","ref":"TheFuzz.Similarity.Overlap.html"},{"type":"function","title":"TheFuzz.Similarity.Overlap.compare/2","doc":"Compares two values using the Overlap Similarity metric and returns the\ncoefficient.  It takes the ngram size as the third argument, and, if\nnone is provided, assumes that you want to use 1.","ref":"TheFuzz.Similarity.Overlap.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.Overlap.compare/2","doc":"iex> TheFuzz.Similarity.Overlap.compare(\"compare me\", \"to me\")\n    0.8\n    iex> TheFuzz.Similarity.Overlap.compare(\"compare me\", \"to me\", 2)\n    0.5\n    iex> TheFuzz.Similarity.Overlap.compare(\"or me\", \"me\", 1)\n    1.0","ref":"TheFuzz.Similarity.Overlap.html#compare/2-examples"},{"type":"function","title":"TheFuzz.Similarity.Overlap.compare/3","doc":"","ref":"TheFuzz.Similarity.Overlap.html#compare/3"},{"type":"module","title":"TheFuzz.Similarity.Tversky","doc":"This module contains functions to calculate the [Tversky index\n](https://en.wikipedia.org/wiki/Tversky_index) between two given\nstrings","ref":"TheFuzz.Similarity.Tversky.html"},{"type":"function","title":"TheFuzz.Similarity.Tversky.compare/2","doc":"Calculates the Tversky index between two given strings with\na default ngram size of 1, alpha of 1 and beta of 1\n\nThis is equivalent of Tanimoto coefficient","ref":"TheFuzz.Similarity.Tversky.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.Tversky.compare/2","doc":"iex> TheFuzz.Similarity.Tversky.compare(\"contact\", \"context\")\n    0.5555555555555556\n    iex> TheFuzz.Similarity.Tversky.compare(\"ht\", \"hththt\")\n    0.3333333333333333","ref":"TheFuzz.Similarity.Tversky.html#compare/2-examples"},{"type":"function","title":"TheFuzz.Similarity.Tversky.compare/3","doc":"Calculates the Tversky index between two given strings with\nthe specified options passed as a map of key, value pairs.\n\n#### Options\n- **n_gram_size**: positive integer greater than 0, to tokenize the strings\n- **alpha**: weight of the prototype sequence\n- **beta**: weight of the variant sequence\n\nNote: If any of them is not specified as part of the options object\nthey are set to the default value of 1","ref":"TheFuzz.Similarity.Tversky.html#compare/3"},{"type":"function","title":"Examples - TheFuzz.Similarity.Tversky.compare/3","doc":"iex> TheFuzz.Similarity.Tversky.compare(\"contact\", \"context\", %{n_gram_size: 4, alpha: 2, beta: 0.8})\n    0.10638297872340426\n    iex> TheFuzz.Similarity.Tversky.compare(\"contact\", \"context\", %{n_gram_size: 2, alpha: 0.5, beta: 0.5})\n    0.5","ref":"TheFuzz.Similarity.Tversky.html#compare/3-examples"},{"type":"module","title":"TheFuzz.Similarity.WeightedLevenshtein","doc":"This module contains function to calculate the weighted levenshtein distance\nbetween 2 given strings.","ref":"TheFuzz.Similarity.WeightedLevenshtein.html"},{"type":"function","title":"TheFuzz.Similarity.WeightedLevenshtein.compare/2","doc":"Calculates the weighted levenshtein distance between the given strings with\nthe costs of insert, delete, replace as 1.","ref":"TheFuzz.Similarity.WeightedLevenshtein.html#compare/2"},{"type":"function","title":"Examples - TheFuzz.Similarity.WeightedLevenshtein.compare/2","doc":"iex> TheFuzz.Similarity.WeightedLevenshtein.compare(\"kitten\", \"sitting\")\n    3\n    iex> TheFuzz.Similarity.WeightedLevenshtein.compare(\"sunday\", \"saturday\")\n    3","ref":"TheFuzz.Similarity.WeightedLevenshtein.html#compare/2-examples"},{"type":"function","title":"TheFuzz.Similarity.WeightedLevenshtein.compare/3","doc":"Calculates the weighted levenshtein distance between the given strings with\ncosts for insert, delete and replace provided as a Map in the third argument.","ref":"TheFuzz.Similarity.WeightedLevenshtein.html#compare/3"},{"type":"function","title":"Examples - TheFuzz.Similarity.WeightedLevenshtein.compare/3","doc":"iex> weights = %{delete: 10, insert: 0.1, replace: 1}\n    iex> TheFuzz.Similarity.WeightedLevenshtein.compare(\"book\", \"back\", weights)\n    2\n    iex> weights = %{delete: 10, insert: 1, replace: 1}\n    iex> TheFuzz.Similarity.WeightedLevenshtein.compare(\"clms blvd\", \"columbus boulevard\", weights)\n    9","ref":"TheFuzz.Similarity.WeightedLevenshtein.html#compare/3-examples"},{"type":"behaviour","title":"TheFuzz.StringMetric","doc":"Specifies the string metric api which an module needs to implement to provide\nstring comparison methods","ref":"TheFuzz.StringMetric.html"},{"type":"callback","title":"TheFuzz.StringMetric.compare/2","doc":"","ref":"TheFuzz.StringMetric.html#c:compare/2"},{"type":"module","title":"TheFuzz.Util","doc":"Utilities for TheFuzz.","ref":"TheFuzz.Util.html"},{"type":"function","title":"TheFuzz.Util.deduplicate/1","doc":"Removes duplicates from a string (except for c)","ref":"TheFuzz.Util.html#deduplicate/1"},{"type":"function","title":"Example - TheFuzz.Util.deduplicate/1","doc":"iex> TheFuzz.Util.deduplicate(\"buzz\")\n    \"buz\"\n    iex> TheFuzz.Util.deduplicate(\"accept\")\n    \"accept\"","ref":"TheFuzz.Util.html#deduplicate/1-example"},{"type":"function","title":"TheFuzz.Util.intersect/2","doc":"Finds the intersection of two lists.  If Strings are provided, it uses the\ncodepoints of said string.","ref":"TheFuzz.Util.html#intersect/2"},{"type":"function","title":"Example - TheFuzz.Util.intersect/2","doc":"iex> TheFuzz.Util.intersect(~c\"context\", ~c\"contentcontent\")\n    ~c\"contet\"\n    iex> TheFuzz.Util.intersect(\"context\", \"contentcontent\")\n    [\"c\", \"o\", \"n\", \"t\", \"e\", \"t\"]","ref":"TheFuzz.Util.html#intersect/2-example"},{"type":"function","title":"TheFuzz.Util.is_alphabetic?/1","doc":"Checks to see if a string is alphabetic.","ref":"TheFuzz.Util.html#is_alphabetic?/1"},{"type":"function","title":"Example - TheFuzz.Util.is_alphabetic?/1","doc":"iex> TheFuzz.Util.is_alphabetic?(\"Jason5\")\n    false\n    iex> TheFuzz.Util.is_alphabetic?(\"Jason\")\n    true","ref":"TheFuzz.Util.html#is_alphabetic?/1-example"},{"type":"function","title":"TheFuzz.Util.len/1","doc":"Finds the length of a string in a less verbose way.","ref":"TheFuzz.Util.html#len/1"},{"type":"function","title":"Example - TheFuzz.Util.len/1","doc":"iex> TheFuzz.Util.len(\"Jason\")\n    5","ref":"TheFuzz.Util.html#len/1-example"},{"type":"function","title":"TheFuzz.Util.ngram_tokenize/2","doc":"[ngram tokenizes](http://en.wikipedia.org/wiki/N-gram) the string provided.","ref":"TheFuzz.Util.html#ngram_tokenize/2"},{"type":"function","title":"Example - TheFuzz.Util.ngram_tokenize/2","doc":"iex> TheFuzz.Util.ngram_tokenize(\"abcdefghijklmnopqrstuvwxyz\", 2)\n    [\"ab\", \"bc\", \"cd\", \"de\", \"ef\", \"fg\", \"gh\", \"hi\", \"ij\", \"jk\", \"kl\", \"lm\",\n    \"mn\", \"no\", \"op\", \"pq\", \"qr\", \"rs\", \"st\", \"tu\", \"uv\", \"vw\", \"wx\", \"xy\",\n    \"yz\"]","ref":"TheFuzz.Util.html#ngram_tokenize/2-example"}],"proglang":"elixir","content_type":"text/markdown","producer":{"name":"ex_doc","version":"0.38.2"}}